import {Component} from 'react';
// Or import all of React and use React.Component

class Counter extends Component{
    constructor(props){
        super(props);
        this.state = {
            count: 0
        }
    }
    render(){
        return (
            <div>{this.state.count}</div>
        );
    };
}

export default Counter;
